<?php
function convert_data($data){
	$image = base64_decode(str_replace('data:image/png;base64,', '',$data)); //记得要将base64解码，还有去除base64码前缀
	header('Content-Type: image/png');
	save_to_file($image);
}
function save_to_file($image){

	$fp = fopen("2.png", 'w');
	fwrite($fp, $image);
	fclose($fp);
}

convert_data("data:image/png;base64,");

